import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Home from './components/Home';

function App() {
  return (
    <>
      <Navbar />
      <Hero />
      <main className="container my-5">
        <Home />
      </main>
    </>
  );
}

export default App;
